<node CREATED="1436148267548" MODIFIED="1436148267548" TEXT="int mid = start + (end - start + 1)/2;"/>
<node CREATED="1436148267548" MODIFIED="1436148267548" TEXT=""/>
<node CREATED="1436148267549" MODIFIED="1436148267549" TEXT="if (nums[start] &lt; nums[mid]) {">
