</node>
<node CREATED="1436148267551" MODIFIED="1436148267551" TEXT="} else min = nums[end];"/>
<node CREATED="1436148267552" MODIFIED="1436148267552" TEXT=""/>
<node CREATED="1436148267552" MODIFIED="1436148267552" TEXT="return min;"/>
</node>
<node CREATED="1436148267553" ID="ID_529037481" MODIFIED="1436148267553" TEXT="}"/>
</node>
