<node CREATED="1438486218412" MODIFIED="1438486218412" TEXT="int tar = nums.length - k;"/>
<node CREATED="1438486218412" MODIFIED="1438486218412" TEXT="int lo = 0;"/>
<node CREATED="1438486218413" MODIFIED="1438486218413" TEXT="int hi = nums.length - 1;"/>
<node CREATED="1438486218414" MODIFIED="1438486218414" TEXT="while (true) {">
