<node CREATED="1438486218415" MODIFIED="1438486218415" TEXT="if (tar &lt; j)                hi = j - 1;"/>
<node CREATED="1438486218416" MODIFIED="1438486218416" TEXT="else if (tar &gt; j)        lo = j + 1;"/>
<node CREATED="1438486218416" MODIFIED="1438486218416" TEXT="else break;"/>
</node>
<node CREATED="1438486218417" MODIFIED="1438486218417" TEXT="}"/>
<node CREATED="1438486218418" MODIFIED="1438486218418" TEXT="return nums[tar];"/>
</node>
<node CREATED="1438486218418" ID="ID_1838689045" MODIFIED="1438486218418" TEXT="}"/>
<node CREATED="1438486218419" FOLDED="true" ID="ID_1210171001" MODIFIED="1438486235167" TEXT="public int partition(int[] a, int lo, int hi) {">
<node CREATED="1438486218420" MODIFIED="1438486218420" TEXT="if (lo == hi)        return lo;"/>
<node CREATED="1438486218420" MODIFIED="1438486218420" TEXT="int i = lo;"/>
<node CREATED="1438486218421" MODIFIED="1438486218421" TEXT="int j = hi+1;"/>
<node CREATED="1438486218421" MODIFIED="1438486218421" TEXT="int v = a[lo];"/>
<node CREATED="1438486218422" MODIFIED="1438486218422" TEXT="while(true) {">
<node CREATED="1438486218423" MODIFIED="1438486218423" TEXT="while (a[++i] &lt; v)">
<node CREATED="1438486218423" MODIFIED="1438486218423" TEXT="if (i == hi)        break;"/>
</node>
<node CREATED="1438486218424" MODIFIED="1438486218424" TEXT="while (a[--j] &gt; v)">
<node CREATED="1438486218425" MODIFIED="1438486218425" TEXT="if (j == lo)        break;"/>
</node>
<node CREATED="1438486218425" MODIFIED="1438486218425" TEXT="if (i &gt;= j)        break;"/>
<node CREATED="1438486218426" MODIFIED="1438486218426" TEXT="exch(a, i, j);"/>
</node>
<node CREATED="1438486218426" MODIFIED="1438486218426" TEXT="}"/>
<node CREATED="1438486218427" MODIFIED="1438486218427" TEXT="exch(a, lo, j);"/>
<node CREATED="1438486218427" MODIFIED="1438486218427" TEXT="return j;"/>
</node>
<node CREATED="1438486218428" ID="ID_546194351" MODIFIED="1438486218428" TEXT="}"/>
